<p>​	拍摄起床闹钟⏰画面，闹钟声音可以后期加上，可以先将窗帘拉上。开头先来个黑色的空境然后播放闹钟声音，然后拍摄演员听到闹钟声音起床的画面，随后拉开窗帘，这一幕结束，切镜画面二</p>
